import React from 'react';
import NavBar from './layout/NavBar';
import Search from "./layout/Search";
import './App.css';

const App = () => {
    return (
        <div className="App">
            <NavBar/>
            <div className="container">
                <Search searchUsers={this.searchUsers}/>
            </div>
        </div>
    );
};


export default App;
